import React from 'react';
import './App.css';
import Projects from '../src/components/Projects';
import Education from '../src/components/Education';
import { Home, About, Contact, Navigation } from '../src/components';
import { Route } from 'react-router-dom';

const App = () => {
    return (
        <div className="route-container">
            <Route exact path="/" >
            <Home />
            </Route>

            {/* <Route path="/About">
            <About />
            </Route> */}

            <Route path="/Contact">
            <Contact />
            </Route>

            <Route path="/Education">
                <Education />
            </Route>

            <Route path="/Projects">
                <Projects />
            </Route>

        </div>
    );
};

export default App;
